  selector: 'app-clan',
  templateUrl: './clan.component.html',
  styleUrls: ['./clan.component.css']
})
export class ClanComponent {

  posts: any[] = [];

  constructor(private router: ActivatedRoute) {
    const id = this.router.snapshot.paramMap.get('id');
  }

  ngOnInit() {

  }

}
